			this.$refs.reloadButton.classList.add('spin');

			socket.emit('update_userFavorites');

			if (localStorage.getItem('spotifyUser')) {
				socket.emit('update_userSpotifyPlaylists', localStorage.getItem('spotifyUser'));
			}
